    value: Please note that there are expenses disclosed on Schedule B for Line 21b
      for which this employee did not meet the definition of Federal Election Activity.  The
      disbursement to Schorr Johnson on 9/21/2005 for $352.00 for AFLAC payroll was
      paid out of the Federal account in error.  It was refunded to the Committee
      on 10/7/2005 and re-issued from the appropriate Non-Federal account.  Salaries
      for all other employees were appropriately paid from a non-federal account.    The
      transfer of funds to our non-federal accounts were for cash flow purposes as
      noted on the report and were not used to finance activities in connection with
      federal elections or any other allocable administrative activity.    Memo entries
      on Schedule A from Dollars for Democrats and from the State Party Democratic
      Victory Fund reflect the gross amounts raised
  - name: AMENDED CD
