      period.  Please note that state party committees have been reporting memo entries
      on Schedule A for contributions received by the joint fundraising program during
      the reporting period in which the contribution was received irrespective of
      whether transfers have been made.  Transfers reflecting memo entries on Schedule
      A for these reports are disclosed on this report for the 3rd quarter of 2005.    Please
