  input: '"TEXT","F3XN","C00165688","Please note that there are expenses disclosed
    on Schedule B for Line 21b for which this employee did not meet the definition
    of Federal Election Activity.  The disbursement to Schorr Johnson on 9/21/2005
    for $352.00 for AFLAC payroll was paid out of the Federal account in error.  It
    was refunded to the Committee on 10/7/2005 and re-issued from the appropriate
    Non-Federal account.  Salaries for all other employees were appropriately paid
    from a non-federal account.    The transfer of funds to our non-federal accounts
    were for cash flow purposes as noted on the report and were not used to finance
    activities in connection with federal elections or any other allocable administrative
    activity.    Memo entries on Schedule A from Dollars for Democrats and from the
    State Party Democratic Victory Fund reflect the gross amounts raised, while the
    transfers to the North Carolina Democratic Party reflect the net amount distributed
    to the Committee to date.  Accordingly, there will always be a difference between
    the two amounts.  Transfers are made on an as-needed basis and no transfers were
    made during this reporting period.  Please note that state party committees have
    been reporting memo entries on Schedule A for contributions received by the joint
    fundraising program during the reporting period in which the contribution was
    received irrespective of whether transfers have been made.  Transfers reflecting
    memo entries on Schedule A for these reports are disclosed on this report for
    the 3rd quarter of 2005.    Please note that there were no disbursements disclosed
    on Line 30 because we have not made any disbursements for federal election activity
    nor did we have any employee who spent more than 25% of their time in connection
    with a federal election and/or federal election activity."'
